import React from 'react';
import classes from "./Contact.module.css";
import { FaLinkedinIn, FaGithub, FaHackerrank } from 'react-icons/fa';
import { motion } from "framer-motion"
const handleURL=(url) =>{
    return() =>
         window.open(url,"_blank")
}
const Contact = () =>{
    return(
        <>
        <div className={classes.Contact} id="contact">
        <h1>Connect</h1>
         <div className={classes.ContactIcons}>
             <div>
             <FaLinkedinIn color='white' size='65px' style={{padding:'1%'}} onClick={handleURL('https://www.linkedin.com/in/ritik-ahlawat-28b1371ab/')}></FaLinkedinIn>
             </div>
             <div>
             <FaGithub color='white' size='65px' style={{padding:'1%'}} onClick={handleURL('https://github.com/ritik1234')}></FaGithub>
             </div>
             <div>
             <FaHackerrank color='white' size='65px' style={{padding:'1%'}} onClick={handleURL('https://www.hackerrank.com/ritikahlawat08')}></FaHackerrank>
             </div>
         </div>
        </div> 
        </>
    );
}

export default Contact;
